INSERT INTO `families` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Паслёновые', 'Паслёновые (лат. Solanaceae) — семейство двудольных спайнолепестных растений, содержащее много съедобных и культивируемых видов, таких как картофель, баклажан, табак, томат и овощной перец (не путать с растениями семейства Перечные), стручковый перец, дереза, паслён, паслён чёрный, пепино и санберри. К этому же семейству относятся и такие растения, как дурман и белена, известные своей ядовитостью. Семейство Паслёновые включает более 2,5 тысяч видов.', '2021-06-07 05:10:20', '2021-06-07 05:10:21'),
(2, 'Тыквенные', 'Ты́квенные, или Тыквовые (лат. Cucurbitáceae) — семейство двудольных цветковых растений. Большинство тыквенных (всех их насчитывается более 600 видов) — однолетние или многолетние травы, перезимовывающие при посредстве корневых клубней или нижних частей стебля, и лишь немногие из них кустарники и полукустарники. Единственная древесная форма семейства — редкое растение дендросициос, эндемик острова Сокотра.\r\n\r\nПредставители этого семейства широко распространены по земной поверхности, за исключением всех холодных стран, но большинство их встречается под тропиками, северная граница распространения в Европе почти совпадает с северной границей дуба, в Старом Свете больше родов (54), нежели в Новом Свете; семь родов (Мелотрия, Кораллокарпус, Люффа, Огурец, Alsomitra, Cayaponia и Sicyos) встречаются в Старом и Новом Свете.\r\n\r\nВиды семейства находят широкое применение: плоды многих из них съедобны (дыни, огурцы, тыквы, арбузы, виды родов Акантосициос, Тельфайрия, Чайот и др.), другие виды идут на изготовление сосудов и музыкальных инструментов (Лагенария), губок и набивочного материала (Люффа) и т. п. Некоторые виды являются лекарственными или разводятся как декоративные растения (Переступень, Люффа, Лагенария). ', '2021-06-07 05:12:21', '2021-06-07 05:12:22'),
(3, 'Капустные', 'Капу́стные, или Капу́стовые, или Бра́ссиковые (лат. Brassicáceae), также Крестоцве́тные (Crucíferae) — семейство двудольных растений отдела Покрытосеменные (Цветковые), включающее в себя однолетние и многолетние травы, изредка полукустарники или кустарники.\r\n\r\nОбъём семейства — 372 рода и более 4 тысяч видов. Отличительной особенностью семейства является обилие двулетних монокарпичных (то есть цветущих лишь на последнем году жизни) трав.\r\n\r\nКапуста является важнейшим для человека представителем этого семейства. ', '2021-06-07 05:13:42', '2021-06-07 05:13:44');
