INSERT INTO `species` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Solanum lycopersicum', 'Тома́т или помидóр (лат. Solánum lycopérsicum) — однолетнее или многолетнее травянистое растение, вид рода Паслён (Solanum) семейства Паслёновые (Solanaceae). Возделывается как овощная культура; выращивается ради съедобных плодов — сочных многогнёздных ягод различной формы и окраски, также называемых томатами или помидорами.', '2021-06-07 07:41:18', '2021-06-07 07:41:18'),
(2, 'Cucumis sativus', 'Огуре́ц обыкнове́нный, или Огурец посевно́й (лат. Cucumis sativus), — однолетнее травянистое растение, вид рода Огурец (Cucumis) семейства Тыквенные (Cucurbitaceae), овощная культура.', '2021-06-07 07:43:07', '2021-06-07 07:43:08');
